import React from "react";
import Header from "../../../Components/Header";
import { Body, CardLogin, InputLnd, InputsContainers, Logo } from "./styled";
import lnd from "../../../assets/img/LND_2.png"



const Login = () => {


    return(
        <Body>
            <CardLogin>
                <Logo src={lnd}/>
                <InputsContainers>
                    <InputLnd placeholder="E-mail"></InputLnd>
                    <InputLnd placeholder="Senha"></InputLnd>
                </InputsContainers>
            </CardLogin>
        </Body>
    )

}

export default Login;
